export interface IValidationBlob {
  field?: string;
  required: boolean;
  pattern?: RegExp;
}

export const _contactInfoValidationBlob: IValidationBlob[] = [
  {
    field: 'firstname',
    required: true,
    pattern: /^([a-zA-Z0-9 _-]+)$/
  },
  {
    field: 'lastname',
    required: true,
    pattern: /^([a-zA-Z0-9 _-]+)$/
  },
  {
    field: 'email',
    required: true,
    pattern: /^\w+@[a-zA-Z_]+?\.[a-zA-Z]{2,3}$/
  },
  {
    field: 'phone',
    required: true,
    pattern: /^([0-9]{10})$/
  },
  {
    field: 'employer',
    required: true,
    pattern: /^([a-zA-Z0-9 _-]+)$/
