      if (isClonedItem) {
        addUpcDisabled = true;
      } else {
        if (!gtin && !corporateItemCode) {
          addUpcDisabled = true;
        } else {
          if (!warningText || !itemDescription || isProp65 == null || isOnLabel == null || foodInd == null) {
